import React, {useState} from 'react';
import Grid from '@mui/material/Unstable_Grid2/Grid2';
import ValueChanger from './ValueChanger';
import Button from '@mui/material/Button';

function ChannelChanger(props){
    const [isDisabled, setIsDisabled] = useState(!props.isActive);
    const [buttonText, setButtonText] = useState(isDisabled ? 'Inactive' : 'Active');
    const [isConfirmed, setIsConfirmed] = useState(false);
    console.log("Rerender");
    const sendChange = (newValue) => {
        props.onValueChange(newValue);
    }
    const handleChange = () => {
        if(isConfirmed){
            setIsDisabled(!isDisabled);
            setButtonText(isDisabled ? 'Active' : 'Inactive')
            setIsConfirmed(false);
        }
        else{
            setButtonText("are you sure?")
            setIsConfirmed(true);
        }


    }
    const properties = props.value;
    if(props.isActive){
        return(
            <Grid container spacing={1} sx={{borderLeft: 'solid 2px', borderRight: 'solid 2px', px: 1}}>
            <Grid xs={12} md={12}>
                <h3>Channel {props.channelNumber}</h3>
            </Grid>
            <Grid md={6}>
                    <ValueChanger property={'name'} value={properties['name']} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'coupling'} value={properties['coupling']} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'bwLimit'} value={properties['bwLimit']} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'probe'} value={properties['probe']} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'tdiv'} value={properties['tdiv']} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'timeOffset'} value={properties['timeOffset']} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'vdiv'} value={properties['vdiv']} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'voltageOffset'} value={properties['voltageOffset']} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
            <Grid xs={12}md={12}>
                <Button variant="contained" sx={{background: isConfirmed ? 'yellow' : isDisabled ? 'red' : 'green', width: '100%', height: 50}} onClick={handleChange}>
                    <h3>
                        {buttonText}
                    </h3>
                </Button>
            </Grid>
        </Grid>
        )
    }
    else{
        return(
            <Grid container spacing={1} sx={{borderLeft: 'solid 2px', borderRight: 'solid 2px', px: 1}}>
            <Grid xs={12} md={12}>
                <h3>Channel {props.channelNumber}</h3>
            </Grid>
            <Grid md={6}>
                    <ValueChanger property={'name'} isDisabled={isDisabled} value={''} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'coupling'} isDisabled={isDisabled} value={''} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'bwLimit'} isDisabled={isDisabled} value={false} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'probe'} isDisabled={isDisabled} value={1} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'tdiv'} isDisabled={isDisabled} value={'2MS'} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'timeOffset'} isDisabled={isDisabled} value={0} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'vdiv'} isDisabled={isDisabled} value={'1v'} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
                <Grid md={6}>
                    <ValueChanger property={'voltageOffset'} isDisabled={isDisabled} value={0} keyHistory={props.keyHistory} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
                </Grid>
            <Grid xs={12}md={12}>
                <Button variant="contained" sx={{background: isDisabled ? 'red' : 'green', width: '100%', height: 50}} onClick={handleChange}>
                    <h3>
                        {buttonText}
                    </h3>
                </Button>
            </Grid>
        </Grid>
        )
    }

    console.log(properties);

    
}


export default ChannelChanger;
